import React from 'react';
import './ourWork.css';
import image1 from './mobile.png'
function ourWork() {
    return (
        <div className="ourWorks">
            <h1>Our Projects</h1>
            <div className="imageContainer">
              <img src={image1} className="img-responsive"></img>
                
            </div>
            
        </div>
    );
}

export default ourWork;
